import React, { Component } from 'react'

class Room extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      loading: true,
      people: [],
      totalVisits: 1
    }
  }

  componentWillMount() {
    this.fetchPerson()
  }

  render(){
    return(
      <div className="room-container">
        Hello there
      </div>
    )
  }
}

export default Room
